import React, { Component } from 'react'
import BasePage from './BasePage';
import GenerateApplicationForm from '../components/Forms/GenerateApplicationForm/GenerateApplicationForm';
import BasePageWithCard from './BasePageWithCard';
export default class GenerateApplicaton extends Component {
  render() {
    data= this.props.studentData
    teacherData = this.props.teacherData
    return (
        <BasePageWithCard isAuthenticated={true} data={data} >
       <GenerateApplicationForm data={data} teacherData={teacherData}/>
        </BasePageWithCard>
    )
  }
}
